 wenn Sie diese Einstellung gew\\u00e4hlt haben, l\\u00f6scht das System den Cookie nach dem Verkauf\\/ vermittelten Transaktion. Dies bedeutet, das der Partner keine weitere Provision f\\u00fcr sp\\u00e4tere Verk\\u00e4ufe dieses ie Besuchers erh\\u00e4lt. Wenn Sie die Standardeinstellung gew\\u00e4hlt haben, wird der Cookie nicht gel\\u00f6scht und der Partner erh\\u00e4lt auch f\\u00fcr alle zuk\\u00fcnftigen Auftr\\u00e4ge des Besuchers eine Provision.\"],[\"Enter URL of your normal website. It will be used to display general affiliate link in affiliate pannel.\",\"Bitte geben Sie die URL Ihrer normalen Webseite ein. Sie wird f\\u00fcr die Anzeige eines allgemeinen Partnerlinks in Ihrem Partner-Panel genutzt.\"],[\"TrackByIpDesc\",\"Diese Zur\\u00fcckverfolgung (das sog. Tracking) Ihrer vermittelten Verk\\u00e4ufe \\u00fcber die IP-Adresse wird verwendet, falls kein Cookie gefunden wird. Das System wird den letzten Klick von der gleichen IP-Adresse innerhalb einer bestimmten Zeit als Verkauf bewerten und f\\u00fcr den Partner, der diesen Verkauf vermittelt hat automatisch eine Provision generieren.\"],[\"Affiliate for not referred commission\",\"Partner f\\u00fcr nicht vermittelte Provision\"],[\"SaveUnreferredSaleDesc\",\"Wenn kein Partner diesen Verkauf vermittelt hat,  kann die Provision beim \\\"\\\"Standardpartner\\\"\\\" gespeichert werden, der unten definiert wird. Diese Einstellung kann genutzt werden um alle Verk\\u00e4ufe zur\\u00fcck zu verfolgen, nicht nur die, die von einem Partner vermittelt wurden.\"],[\"Support DirectLink linking\",\"Verlinkung \\u00fcber DirectLinks unterst\\u00fctzen\"],[\"License ID\",\"Lizenz-ID\"],[\"Source message\",\"Urspr\\u00fcngliche Nachricht\"],[\"Translation\",\"\\u00dcbersetzung\"],[\"Language metadata\",\"Sprachmetadaten\"],[\"No language selected\",\"Keine Sprache ausgew\\u00e4hlt\"],[\"DirectLink\",\"DirectLink\"],[\"Display banner statistics\",\"Bannerstatistiken anzeigen\"],[\"Channel: \",\"Kanal:\"],[\"Banner: \",\"Banner :\"],[\"Are you sure you want to do this operation on the table?\",\"Sind Sie sicher, dass Sie diese \\u00c4nderungen in der Tabelle vornehmen m\\u00f6chten?\"],[\"Active wallpaper can not be deleted\",\"Aktives Hintergrundbild kann nicht gel\\u00f6scht werden\"],[\"Upload failed with error: %s\",\"Hochladevorgang fehlgeschlagen mit Fehler: %s\"],[\"Data are cached\",\"Daten wurden gecached\"],[\"Exported file you can download here\",\"Exportierte Datei k\\u00f6nnen Sie hier herunterladen\"],[\"Save language metadata\",\"Sprachmetadaten speichern\"],[\"Your affiliate program name. It can be your company name if you want. This name can be visible in the signup form (depends on theme).\",\"Der Name Ihres Partnerprogramms. Es kann auch Ihr Firmenname sein, wenn Sie m\\u00f6chten. Der Name ist  kann im Registrierungsformular angezeigt werden (ist abh\\u00e4ngig vom Thema).\"],[\"If checked, the invoice will be generated for every payment you make. Both affiliates and you will be able to check the invoice in the payouts history.\",\"Wenn Sie das entsprechende Kontrollk\\u00e4stchen markiert haben, wird f\\u00fcr jede Auszahlung, die Sie machen eine Rechnung erzeugt. Sowohl Sie als auch Ihr  Partner k\\u00f6nnen die Rechnungen im Auszahlungsverlauf pr\\u00fcfen.\"],[\"Support VAT\",\"Mehrwertsteuer unterst\\u00fctzen\"],[\"If checked, your affiliates from EU countries will be able to specify their VAT number and percentage.<br\\/>Also, for these affiliates the payouts are computed together with the VAT.\",\"Wenn Sie das entsprechende Kontrollk\\u00e4stchen markiert haben,k\\u00f6nnen Ihre Partner aus EU-Staaten Ihre Steuernummer und den g\\u00fcltigen Mehrwertsteuersatz eingeben.<br\\/> Au\\u00dferdem werden die Auszahlungen f\\u00fcr diese Partner inklusive der Mehrwertsteuer berechnet.\"],[\"Default VAT percentage used if affiliate doesn;t enter his own percentage\",\"Wenn der Partner keinen, f\\u00fcr sein Land g\\u00fcltigen Mehrwertsteuersatz eingibt, wird eine Standard-Mehrwertsteuersatz f\\u00fcr die Berechnungen herangezogen.\"],[\"Defines how the final payout amount should be computed.<br\\/>If VAT is added to the commissions, the commission amount will be increased with VAT part.\",\"Definiert wie der endg\\u00fcltige Auszahlungsbetrag errechnet werden soll.<br\\/>Wenn MwSt. zu den Provisionen hinzugerechnet wird, wird der Provisionsbetrag entsprechend um den Mehrwertsteueranteil erh\\u00f6ht.\"],[\"Welcome message\",\"Willkommensnachricht\"],[\"You have to agree with the license.\",\"Sie m\\u00fcssen den Lizenzbestimmungen zustimmen.\"],[\"I Agree with the license\",\"Ich stimme den Lizenzbestimmungen zu.\"],[\"Check Requirements\",\"Voraussetzungen pr\\u00fcfen\"],[\"Welcome info\",\"Willkommensinformation\"],[\"Home template\",\"Vorlage f\\u00fcr die Startseite\"],[\"Affiliate manager template\",\"Vorlage f\\u00fcr den Partner-Manager\"],[\"Home edit\",\"Startseite bearbeiten\"],[\"Channel stats report\",\"Statistiken f\\u00fcr Ihre Kan\\u00e4le\"],[\"ChannelStatsReportDescription\",\"\\u00dcbersicht \\u00fcber die Leistungsf\\u00e4higkeit der Kan\\u00e4le, die Sie f\\u00fcr Ihre Banner definiert haben.\"],[\"Add message to this transaction (optional)\",\"Nachricht zu dieser Transaktion hinzuf\\u00fcgen (optional)\"],[\"Unknown tracking\",\"Unbekanntes Tracking\"],[\"Manually created\",\"Manuell angelegt\"],[\"Lifetime referral\",\"Lebenslange Vermittlung\"],[\"More info\",\"Mehr Informationen\"],[\"Failed to add link - invalid url\",\"Link konnte nicht hinzugef\\u00fcgt werden - ung\\u00fcltige URL\"],[\"Open in same window\\/frame\",\"Im selben Fenster\\/Frame \\u00f6ffnen\"],[\"Open in new window\\/frame (_blank)\",\"In neuem Fenster\\/Frame (_blank) \\u00f6ffnen\"],[\"Open in parent window\\/frame (_parent)\",\"In \\u00fcbergeordnetem Fenster \\/ Frame (_parent) \\u00f6ffnen\"],[\"Open in top window\\/frame (_top)\",\"Im Hauptfenster \\/ Frame (_top) \\u00f6ffnen\"],[\"Target\",\"Ziel\"],[\"Class\",\"Kl