"do not move child affiliates\",\"Untergeordnete Partner nicht verschieben\"],[\"move child affiliates to parent of deleted affiliate\",\"untergeordnete Partner zu \\u00fcbergeordnetem Partner des gel\\u00f6schten Partners verschieben\"],[\"Delete affiliate\",\"Partner l\\u00f6schen\"],[\"None wallpaper\",\"Kein Hintergrundbild\"],[\"Select desktop background color\",\"Desktop-Hintergrundfarbe ausw\\u00e4hlen\"],[\"Add custom wallpaper\",\"Benutzerdefiniertes Hintergrundbild hinzuf\\u00fcgen\"],[\"No row selected\",\"Keine Zeile ausgew\\u00e4hlt\"],[\"Getting started\",\"Erste Schritte\"],[\"You have to choose either campaign or banner, not both\",\"Sie k\\u00f6nnen entweder eine Kampagne oder ein Banner ausw\\u00e4hlen. Die Auswahl von beidem ist nicht m\\u00f6glich.\"],[\"Note for merchant - if you want to explain this URL\",\"Mitteilung f\\u00fcr Kaufmann - falls Sie diese URL erkl\\u00e4ren m\\u00f6chten\"],[\"Checking..\",\"Pr\\u00fcfe..\"],[\"This is the default currency of the system. All tracked sales and commissions will be in this main currency.\",\"Dies ist die Standardw\\u00e4hrung des Systems. Alle registrierten Verk\\u00e4ufe und Provisionen werden in dieser W\\u00e4hrung angegeben.\"],[\"Precision defines how the numbers are rounded - how many decimal places after the decimal point will be used\",\"Hier k\\u00f6nnen Sie festlegen, wie Zahlen gerundet werden sollen \\u2013 d.h. auf wie viele Dezimalstellen nach dem Komma gerundet werden soll.\"],[\"This setting controls where to display currency - before ($ 123) or after (123 $) the number\",\"Hier k\\u00f6nnen Sie einstellen, wo das W\\u00e4hrungssymbol angezeigt werden soll - vor ($ 123) oder nach (123 $) der Ziffer.\"],[\"If affiliates doesn't specify his minimum payout balance, this value will be used.\",\"Falls Partner keinen minimalen Auszahlungsbetrag festlegen, wird dieser Standardwert verwendet.\"],[\"Affiliates to pay\",\"Partner,die noch ausgezahlt werden m\\u00fcssen\"],[\"No data are matching your search\",\"Keine Daten gefunden, die Ihrer Suchanfrage entsprechen\"],[\"Version Update\",\"Versions-Update\"],[\"Language code is unique for every language. Example of American English code is en-US. The list of most language codes can be found at: <a href='http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx' terget='_blank'>http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx)<\\/a>\",\"Der Sprachencode ist einmalig f\\u00fcr jede Sprache definiert. Beispiel: Amerikanisches Englisch hat den Sprachencode en_US. Eine Liste der meist verwendeten   Sprachencodes kann hier gefunden werden: <a href='http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx' terget='_blank'>http:\\/\\/msdn.microsoft.com\\/en-us\\/library\\/ms533052(VS.85).aspx)<\\/a>\"],[\"Yes, Reload Application\",\"Ja, Anwendung neu laden\"],[\"Request error\",\"Anfragefehler\"],[\"Your session expired.\",\"Ihre Sitzung ist abgelaufen.\"],[\"Invalid server response.\",\"Ung\\u00fcltige Serverantwort.\"],[\"Manual commission\",\"Manuelle Provisionen\"],[\"Brainstorming\",\"Erste Gedanken\"],[\"GetStartedBrainstorming\",\"Dieser erste Schritt ist sehr wichtig \\u2013 machen Sie sich Gedanken \\u00fcber Ihr Partnerprogramm.<br\\/>Sie sollten sich \\u00fcberlegen, was Sie mit Ihrem Partnerprogramm erreichen m\\u00f6chten. Welche Provisionswerte k\\u00f6nnen Sie zahlen?<br\\/> Sind diese attraktiv genug im Vergleich zu Ihrer Konkurrenz? Wie k\\u00f6nnen Sie Partner gewinnen?\"],[\"Review your settings\",\"\\u00dcberpr\\u00fcfen Sie Ihre Einstellungen erneut\"],[\"GetStartedSettings\",\"Die Anwendung wurde so voreingestellt, dass Sie mit der Standard-Konfiguration arbeiten k\\u00f6nnen. <br\\/> Trotzdem sollten Sie die Konfiguration pr\\u00fcfen und sie gegebenenfalls Ihren Bed\\u00fcrfnissen und W\\u00fcnschen anpassen.<br\\/>Sie k\\u00f6nnen die Konfiguration \\u00e4ndern unter <strong>Konfiguration & Extras -> Konfiguration<\\/strong>. <br\\/><br\\/>Eine detaillierte aller Konfigurationsoptionen finden Sie im Benutzerhandbuch oder in der Wissensdatenbank.\"],[\"Define your commissions\",\"Definieren Sie Ihre Provisionen\"],[\"Add banners and other creatives\",\"Banner und andere Creatives hinzuf\\u00fcgen\"],[\"GetStartedCreatives\",\"Im <strong>Banner-Manager<\\/strong> k\\u00f6nnen Sie verschiedene Creatives von Textlinks, Standard-Bild-Bannern bis hin zu HTML-,Flash-, oder Werbe-E-Mail-Banner verwalten.<br\\/>F\\u00fcr jedes Banner muss eine Ziel-URL definiert werden, denn der Besucher wird nach dem Klick auf das Creative \\u00fcber diese Ziel-URL umgeleite.\"],[\"Set up emails\",\"E-Mails einrichten\"],[\"GetStartedEmails\",\"F\\u00fcr die Anwendung ist die E-Mail-Funktionalit\\u00e4t ein wesentlicher Bestandteil.Diese beinhaltet:<ul><li><strong>E-Mail-Konto<\\/strong> - wie die E-Mails gesendet werden sollen. Sie k\\u00f6nnen entweder die E-Mail()Funktion oder SMTP-Server ausw\\u00e4hlen.<\\/li><li><strong>E-Mail-Vorlagen<\\/strong> - diese Vorlagen werden f\\u00fcr E-Mails verwendet, die automatisch vom System versendet werden, z.B. Benachrichtigungen \\u00fcber eine Registrierung oder  Verk\\u00e4ufe, etc. <\\/li><li><strong>E-Mail-Benachrichtigungen<\\/strong> - Sie k\\u00f6nnen festlegen, welche Benachrichtigungen Sie als H\\u00e4ndler erhalten m\\u00f6chten und welche Benachrichtigungen Ihre Partner erhalten sollen.<\\/li><\\/ul> Stellen Sie sicher, dass Ihr E-Mail-Konto richtig konfiguriert ist \\u2013 pr\\u00fcfen Sie dies durch das Senden einer Testnachricht. Sollte Ihr E-Mail-Konto nicht richtig konfiguriert sein, k\\u00f6nnen Ihre Partner  evtl. keine Benachrichtigungen \\u00fcber Ihre Registrierung etc. erhalten.\"],[\"Customize your affiliate signup form\",\"Registrierungsformular f\\u00fcr Partner benutzerspezifisch anpassen\"],[\"GetStartedSignupForm\",\"\\u00dcberpr\\u00fcfen Sie das Standard-Registrierungsformular und passen Sie es gegebenenfalls an Ihre W\\u00fcnsche und Bed\\u00fcrfnisse an. <br\\/><br\\/>Zum Registrierungsformular geh\\u00f6rt auch eine kleine Mini-Site, welche Informationen rund um Ihr Partnerprogramm bereith\\u00e4lt.<br\\/> Sie k\\u00f6nnen diese Mini-Site anpassen und verwenden oder sie l\\u00f6schen und nur das Registrierungsformular verwenden.\"],[\"Customize affiliate panel\",\"Partner-Panel benutzerspezifisch anpassen\"],[\"GetStartedAffPanel\",\"Das Partner-Panel ist sehr flexibel anpassbar.<br\\/> Sie k\\u00f6nnen festlegen, wie das Men\\u00fc aussehen soll, welcher Inhalt angezeigt werden soll oder sogar eigene Inhalte schreiben, oder Sie k\\u00f6nnen zu anderen Webseiten verlinken.\"],[\"GetStartedIntegrate\",\"Integration ist der Weg wie Sie das Partnerprogramm mit Ihrer bestehenden Webseite,Ihrem Warenkorb oder Zahlungsportal verbinden k\\u00f6nnen und das Partnerprogramm somit \\u00fcber Kaufvorg\\u00e4nge benachrichtigt wird.<br\\/> Nach einer Benachrichtigung registriert das Partnersystem den Kauf, findet den Partner,der den Kauf vermittelt hat und sorgt daf\\u00fcr, dass dieser die entsprechende Provision erh\\u00e4lt. <br\\/><br\\/>Integration bedeutet normalerweise nur, dass Ihren Webseiten wenige Code-Zeilen hinzugef\\u00fcgt werden m\\u00fcssen. Sie finden auch Schritt-f\\u00fcr-Schritt-Anleitungen f\\u00fcr die Integration in den meisten Warenkorbsystemen oder Zahlungsportalen\"],[\"Test everything\",\"Jetzt alles testen\"],[\"Promote your affiliate program\",\"Bewerben Sie ihr Partnerprogramm\"],[\"GetStartedPromote\",\"Nachdem Sie in einem Testlauf die Integration des Partnerprogramms mit Ihrer Webseite erfolgreich abgeschlossen haben, k\\u00f6nnen Sie nun mit der Werbung f\\u00fcr Ihr neues Partnerprogramm beginnen, um  bald m\\u00f6glichst viele neue Partner zu gewinnen.<br\\/><br\\/>Sie sollten unbedingt einen Link erstellen, der direkt auf das Registrierungsformular f\\u00fcr Ihr Partnerprogramm verweist bzw. zu einer Seite mit Informationen rund um Ihr Partnerprogramm. Benennen Sie den Link eindeutig, z.B. Partnerprogramm, Geld verdienen f\\u00fcr Webmaster, Partner werden leicht gemacht, o.\\u00e4. Der Link soll die Besucher Ihrer Webseite dazu animieren an Ihrem Partnerprogramm teilzuhaben und selbst Partner zu werden.<br\\/><br\\/> Um ein gr\\u00f6\\u00dftm\\u00f6gliches Zielpublikum zu erreichen, sollten Sie Ihr Partnerprogramm in entsprechenden Partner-Verzeichnissen anmelden. Es gibt unz\\u00e4hlige solcher Verzeichnisse im Internet, die jeden Tag von erfahrenen Partnern besucht werden.\"],[\"Ad Channels\",\"Kan\\u00e4le hinzuf\\u00fcgen\"],[\"Advanced tools\",\"Erweiterte Funktionalit\\u00e4ten\"],[\"Subaffiliate Sale Stats\",\"Verkaufsstatistiken Ihrer untergeordneten Partner\"],[\"ContactUs\",\"Kontakt\"],[\"Promotion tips\",\"Tipps f\\u00fcr erfolgreiche Werbung\"],[\"Frequently asked questions\",\"H\\u00e4ufig gestellte Fragen\"],[\"Advanced tracking\",\"Erweitertes Tracking\"],[\"DirectLinks explained\",\"DirectLinks erkl\\u00e4rt\"],[\"Sale counts\",\"Anzahl von Verk\\u00e4ufen\"],[\"CTR (raw \\/ unique)\",\"Klickrate  (alle\\/eindeutig)\"],[\"Design & Contents settings\",\"Einstellungen Aussehen & Inhalt\"],[\"Payee info\",\"Information f\\u00fcr den Zahlungsempf\\u00e4nger\"],[\"Copy & Paste the text above to your email editor\",\"Bitte f\\u00fcgen Sie den oben stehenden Text mithilfe der Copy&Paste-Funktion in Ihren E-Mail-Editor ein\"],[\"Show TEXT version\",\"TEXT-Version anzeigen\"],[\"Checking for new version...\",\"Pr\\u00fcfe, ob aktuellere Version vorhanden ist...\"],[\"You are running latest version.\",\"Sie haben die neueste Version installiert.\"],[\"Latest version %s is available for download.\",\"Neueste Version %s ist als Download verf\\u00fcgbar.\"],[\"Branding text\",\"Branding-Text\"],[\"Send signup confirmation email\",\"Benachrichtigungs-E-Mail \\u00fcber erfolgreiche Registrierung senden\"],[\"Send new password request email\",\"E-Mail f\\u00fcr neue Kennwortanforderung senden\"],[\"BannersLinksFormatDescription\",\"Sie k\\u00f6nnen benutzerspezifische Formate f\\u00fcr die Generierung von Creatives-Typen definieren\"],[\"CurrencyDescription\",\"Standardw\\u00e4hrung des Partnerprogramms\"],[\"LanguagesDescription\",\"Verwalten Sie Sprachen, \\u00dcbersetzungen und Datums- und Zeitformate\"],[\"LoggingDescription\",\"Erm\\u00f6glicht Ihnen verschiedene Protokollebenen auszuw\\u00e4hlen, alle Aktionen im System zu \\u00fcberwachen und Fehler gegebenenfalls mithilfe der Fehlersuche und-beseitigung zu beheben.\"],[\"ProxyServerConfigDescription\",\"Ist Ihr System hinter einen Proxyserver geschaltet, k\\u00f6nnen Sie diesen hier definieren. Diese Einstellung ist nicht unbedingt notwendig, Sie k\\u00f6nnen jedoch auf sie zur\\u00fcckgreifen, falls Sie Probleme mit dem Herunterladen von Gadgets haben.\"],[\"EmailTemplatesDescription\",\"Bearbeiten Sie die E-Mail-Vorlagen, f\\u00fcr alle automatisch vom System automatisch versendeten E-Mails.\"],[\"Mail Account\",\"E-Mail-Konto\"],[\"MailAccountDescription\",\"Konfigurieren Sie hier Ihr E-Mail-Konto, welches f\\u00fcr die Versendung von E-Mails \\u00fcber das System verwendet werden soll.\"],[\"CookiesSettingsDescription\",\"Konfigurieren Sie hier Ihre  Datenschutzbestimmung bez\\u00fcglich der Verwendung von Cookies und Domains bzw. legen Sie fest, ob Cookies \\u00fcberschrieben werden sollen.\"],[\"FraudProtectionDescription\",\"Der Betrugsschutz kann wiederholte oder betr\\u00fcgerische  Transaktionen ( Klicks, Verk\\u00e4ufe, Vermittlungen etc. ), die von derselben IP-Adresse oder mit dergleichen Bestell-ID kommen automatisch erkennen.<br\\/>Wiederholte Transaktionen k\\u00f6nnen zum Beispiel auftreten, wenn ein Kunde die Seite mit der Best\\u00e4tigung seiner Bestellung aktualisiert; daher wird empfohlen diese Ereignisse heraus zu filtern oder mehrfache Bestellungen mit derselben Bestell-ID abzulehnen.   \"],[\"Payouts Balance\",\"Auszahlungsbetrag\"],[\"PayoutsBalanceDescription\",\"Sie k\\u00f6nnen einen minimalen Auszahlungsbetrag f\\u