n. Die Best\\u00e4tigung erfolgt in der Regel durch das Antworten auf eine Best\\u00e4tigungs-E-Mail,  die an die vom Benutzer angegebene E-Mail-Adresse versendet wird. Somit wird die Gefahr des Missbrauchs durch die Angabe falscher E-Mail-Adressen oder die Verwendung von E-Mail-Adressen unwissender Parteien verhindert.\"],[\"Newsletters\",\"Newsletter\"],[\"Here you can find list of your Mailing Lists. You can manage listings by editing existing or adding new Newsletter.\",\"Hier finden Sie eine \\u00dcbersicht Ihrer Mailing-Listen. Sie k\\u00f6nnen die Mailing-Listen verwalten, in dem sie bereits angelegte Mailing-Listen bearbeiten oder neue Newsletter hinzuf\\u00fcgen.\"],[\"Add new Mailing list\",\"Neue Mailing-Liste hinzuf\\u00fcgen\"],[\"Other\",\"Anderes\"],[\"For changes to take effect restart of application is needed. Do you want to restart now?\",\"Um die vorgenommenen \\u00c4nderungen zu aktivieren ist ein Neustart der Anwendung notwendig. M\\u00f6chten Sie Ihren Computer jetzt neu starten?\"],[\"Unique clicks\",\"Eindeutige Klicks\"],[\"Select your preferred theme for your affiliate panel.\",\"W\\u00e4hlen Sie Ihr bevorzugtes Thema f\\u00fcr das Partner-Panel aus.\"],[\"You can contact us directly using this contact form. Your message will be sent to your affiliate manager by email.\",\"Sie k\\u00f6nnen sich direkt \\u00fcber unser Kontaktformular mit uns in Verbindung setzen. Ihre Nachricht wird per E-Mail an Ihren Partner-Manager versendet.\"],[\"With performance reward rule you can reward your affiliates for their performace and motivate them to refer more customers to you.\",\"Mithilfe der Leistungspr\\u00e4mie k\\u00f6nnen Sie Ihre Partner f\\u00fcr Ihre Leistung belohnen und sie motivieren, weitere Kunden an Sie zu vermitteln.\"],[\"You have no private campaign\",\"Sie haben keine private Kampagne erstellt\"],[\"Apply for license key\",\"Freigabecode anfordern\"],[\"Offline Validation Request\",\"Offline-G\\u00fcltigkeitsabfrage\"],[\"Simple PDF\",